  function generateTableHead(table, data) {
    let thead = table.createTHead();
    let row = thead.insertRow();
    var sel=document.createElement("selth")
    var text=document.createTextNode("Select")
    sel.appendChild(text)
    row.appendChild(sel)
    for (let key of data) {
      let th = document.createElement("th");
      let text = document.createTextNode(key);
      th.appendChild(text);
      row.appendChild(th);
    }
  }
  
  function generateTable(table, data) {
    a=0;
    for (let element of data) {
      n=0;
      let row = table.insertRow();
      let selce= row.insertCell(n);
      n++;
      for (key in element) {
        let cell = row.insertCell(n);
        let text = document.createTextNode(element[key]);
        cell.appendChild(text);
        n++;
      }
      let sel=document.createElement('input');
      sel.type='checkbox';
      sel.value=row.cells[1].innerHTML;
      sel.name="checkbox"+a;
      selce.appendChild(sel);
      a++;
    }
  }
  
  let table = document.querySelector("table");
  let data = Object.keys(mountains[0]);
  generateTable(table, mountains);
  generateTableHead(table, data);